                </Accordion.Collapse>
              </Card>
            </Accordion>
          </div>
          <div className="body">
            <div className="row">
              <div className="col-lg-6 col-md-12">
                <h6>Accordion Link</h6>
                <p>
                  <button
                    className="btn btn-primary mr-1"
                    data-toggle="collapse"
                    role="button"
                    aria-expanded="false"
                    aria-controls="collapseExample"
                    onClick={() => {
                      var details = document.getElementById(
                        "collapseExampleopne"
